import { AspectRatio } from "@/components/ui/aspect-ratio";
import { Search } from 'lucide-vue-next';

const images = ref([
  { id: 1, title: 'Mountain at Night', src: 'https://images.unsplash.com/photo-1571115177098-24ec42ed2044?w=800&dpr=2&q=80' },
  { id: 2, title: 'Lonely Tree', src: 'https://images.unsplash.com/photo-1506748686214-e9df14d4d9d0?w=800&dpr=2&q=80' },
  { id: 3, title: 'City Lights', src: 'https://images.unsplash.com/photo-1499346038450-9b4c1df4e1d8?w=800&dpr=2&q=80' },
  { id: 4, title: 'Misty Forest', src: 'https://images.unsplash.com/photo-1484972759836-b93f9dfc1e9f?w=800&dpr=2&q=80' },
  { id: 5, title: 'Snowy Mountains', src: 'https://images.unsplash.com/photo-1484406566174-9da000fda645?w=800&dpr=2&q=80' },
  { id: 6, title: 'Desert Sands', src: 'https://images.unsplash.com/photo-1507525428034-b723cf961d3e?w=800&dpr=2&q=80' },
]);

const searchQuery = ref('');

const filteredImages = computed(() => {
  if (!searchQuery.value) {
    return images.value;
  }
  return images.value.filter((image) =>
    image.title.toLowerCase().includes(searchQuery.value.toLowerCase())
  );
});
